import React from "react";

function Table_dar(props){
    let border_color,boy=[];
    
    switch(props.bg){
        case "var(--primary)" : border_color = "border-primary"; break;
        case "var(--danger)"  : border_color = "border-danger" ; break;
        case "var(--success)" : border_color = "border-success"; break;
        case "var(--warning)" : border_color = "border-warning"; break;
        default : console.log("NONE") ;break;
    }

    if(props.wlad_p ? true:false){
        for( let i=0 ; i<4 ; i++ ){
            boy[i] = props.wlad_p[i] 
            console.log(boy[i])
        }
    }else if(props.wlad_s ? true:false){
        for( let i=0 ; i<4 ; i++ ){
            boy[i] = props.wlad_s[i] 
            console.log(boy[i])
        }
    }else{
        for( let i=0 ; i<4 ; i++ ){
            boy[i] = "block" 
            console.log(boy[i])
        } 
    }
    
    return(
    <div className={`${props.classN} border ${border_color} d-flex justify-content-center align-items-center rounded`}
    style={{backgroundColor:props.bg}}> 
        <div className="Circle-player rounded-circle">
           <div className="rounded-circle border Boy Boy1" style={{backgroundColor:props.bg}}> </div>
           <div className="rounded-circle border Boy Boy2" style={{backgroundColor:props.bg}}> </div>
           <div className="rounded-circle border Boy Boy3" style={{backgroundColor:props.bg}}> </div>
           <div className="rounded-circle border Boy Boy4" style={{backgroundColor:props.bg}}> </div>
        </div>
    </div>
    )
}
export default React.memo(Table_dar)
